INSERT INTO `tbl_artikel` VALUES (24, '16', 'Kasus Sindrom Putri Tidur di  oom', '<span>Tidak seindah namanya,&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/penyakit/kleine-levin-syndrome?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">Kleine-Levin syndrome&nbsp;</a>atau sindrom putri tidur memaksa pengidapnya untuk tertidur dalam jangka waktu yang sangat panjang. Bukannya terlihat cantik, penderitanya malah mendapatkan banyak efek negatif dari sindrom putri tidur.</span><span>Pekerjaan, kehidupan sosial, pelajaran sekolah, dan aktivitas normal lainnya menjadi sulit dilakukan dan bahkan terbengkalai.&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/artikel/panduan-lengkap-memahami-gangguan-tidur-anda?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">Gangguan tidur</a>&nbsp;yang langka ini tidak hanya terjadi di luar negeri tetapi juga muncul di Indonesia.</span><h2>Kisah sindrom putri tidur di Indonesia</h2>Siti Raida Miranda atau yang biasa dipanggil oleh orang-orang sekitarnya sebagai Echa sudah tiga kali mengalami tidur yang berkepanjangan. Remaja perempuan berusia 13 tahun yang berasal dari Banjarmasin ini pernah tertidur selama hampir dua minggu.Orangtua Echa dengan sabar memandikan dan menyuapinya makanan selama masa ia tertidur. Saat terbangun, remaja perempuan tersebut hanya diam dan tidak memberikan respons apapun. Tidur yang berkepanjangan juga membuat Echa ketinggalan banyak materi sekolah.Pemeriksaan&nbsp;CT scan&nbsp;dan&nbsp;MRI&nbsp;sudah ditempuh untuk mengetahui keanehan yang terjadi, tetapi dari pemeriksaan yang dilakukan tidak terdapat kejanggalan pada otak Echa.Dokter telah memberikan Echa beberapa obat stimulan untuk membantu mengatasi suasana hatinya. Meskipun demikian, sampai sekarang Echa masih dalam pemeriksaan lebih lanjut mengenai apa yang terjadi pada dirinya.Namun, Echa diduga mengalami sindrom putri tidur yang membuatnya bisa terlelap dalam jangka panjang.<h2>Bagaimana cara mengetahui sindrom putri tidur?</h2><span>Sindrom putri tidur bukanlah gangguan yang mudah untuk diketahui karena terkadang tanda dari sindrom putri tidur hampir serupa dengan gejala&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/artikel/stigma-gangguan-mental?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">gangguan mental</a>&nbsp;lainnya. Bahkan terkadang dibutuhkan waktu kurang lebih empat tahun untuk mengetahuinya secara pasti.</span>Pemeriksaan sindrom putri tidur memerlukan banyak proses untuk mengeliminasi kemungkinan gangguan atau penyakit lainnya. Pemeriksaannya meliputi mempelajari pola tidur, tes&nbsp;MRI, &nbsp;tes pencitraan, pemeriksaan kesehatan mental,&nbsp;CT scan, dan pemeriksaan darah.<h2>Apakah ada cara untuk mengobati sindrom putri tidur?</h2><span>Sampai saat ini belum ada pengobatan yang efektif untuk menanggulangi sindrom putri tidur. Obat-obatan yang diberikan umumnya adalah obat-obat stimulan, seperti&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/obat/modafinil?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">modafinil</a>,&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/obat/amphetamine?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">amphetamin</a>, dan metilfenidat.</span>Obat-obatan tersebut bertujuan untuk mengatasi rasa kantuk yang timbul akibat sindrom putri tidur. Namun, obat stimulan yang diberikan tidak mampu mengubah fungsi kognitif yang terjadi. Selain itu, terdapat juga efek samping dari obat yang dikonsumsi berupa lebih mudah kesal.<span>Terkadang, obat-obatan untuk mengatasi suasana hati, seperti&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/obat/carbamazepine?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">carbamazepine</a>&nbsp;dan&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/obat/lithium?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">litium</a>&nbsp;juga diresepkan untuk mencegah kemunculan sindrom putri tidur.</span>', '2019-08-03 19:06:49', '2020-02-07 09:38:30', '1', '1', '1', 'e37fa6b7708099afb0354ffd4c4a19a6.png', '1');
