INSERT INTO `tbl_artikel` VALUES (34, '17', 'Komunitas Ar-Royyan', 'Assalamualaikum, semua. Hari senin tanggal 18 November 2019&nbsp;SDIT Mentari Ilmu&nbsp;launching Komunitas Ar-Royyan Kereen secara resmi pas pengumuman usai upacara. .<br>Eeh, betewe ini komunitas apa sih? Yup, ini Komunitas buat para siswa pecinta shaum sunnah Senin & Kamis. Karena suka banyaaaak yang suka shaum di sekolah, so udah seharusnya dong kalo kita kasih apresiasi buat para generasi emas Rabbaniyah yang saleh, cerdas, dan kreatif. Nanti ada program menarik di komunitas Ar-Royyan Kereen ini. .<br>Masa iya sih anak-anak SD pada suka puasa dan udah jago puasa Sunnah Senin & Kamis? Wah, kalo gak percaya boleh deh jadi bagian keluarga SDIT Mentari Ilmu Karawang. Daftar langsung ke WA:<br>0813-2205-7915<br>0821-5269-9190<br>Atau datang langsung ke sekolah kami di:<br>SDIT MENTARI ILMU KARAWANG<br>Jl. Perum Karaba Indah I, Kp. Pintu Air, RT 004/RW 004. Desa Wadas,<br>Kec. Telukjambe Timur., Kabupaten Karawang, Jawa Barat 41361<br>Buat ikut antrean jadi siswa baru. Ikuti tes PPDB Sabtu, 14 Desember 2019 daaan... Pastikan diterima deh jadi bagian dari siswa-siswi SDIT Mentari Ilmu Karawang. Udha gitu gabung komunitas ini. Biar liat langsung buktinya gitu... _________________***__________________ ??????????????????????????????????????????????????????????????????????????<br><a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/explore/tags/sditmentariilmu/\">#sditmentariilmu</a> <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/explore/tags/sditmentariilmukaraba/\">#sditmentariilmukaraba</a><br><a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/explore/tags/soleh/\">#soleh</a> <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/explore/tags/smart/\">#smart</a> <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.instagram.com/explore/tags/creative/\">#creative</a> <a target=\"_blank\" rel=\"nofollow\" href=\"https://www