INSERT INTO `tbl_artikel` VALUES (35, '17', 'Open House 2019 SDIT Mentari Ilmu Karawang', 'Yeay! Alhamdulillah, bentar lagi Open House SDIT Mentari Ilmu Karawang. Saatnya gebyar pentas seni dan penampilan lomba-lomba TK se-Karawang. Masya Allah, greget banget rasanya nunggu hari H tiba. Gak sabar pengen liat semuanya. Semoga sukses, Allahu Akbar. .<br>Oh iya, sampe lupa. Mau daftar jadi peserta perlombaan TK se-Karawang juga? Boleh hubungi nomor kontak Miss Ayu di gambar yaah. Semoga sukses.', '2019-11-21 12:42:16', '2020-02-07 09:38:35', '12', NULL, '1', '63d8bcd7902355af6a1accc447764d9d.jpg', '1');
