INSERT INTO `tbl_ekskul` VALUES (36, '16', 'Paskibra', '<b>Paskibra</b><span> merupakan pasukan pengibar bendera yang bertugas sebagai pengibar bendera pusaka di sekolah.<br></span>Paskibra SMA IT Mentari Ilmu Karawang merupakan Ekstrakurikuler non seni yang dibentuk pada tahun ajaran 2019/2020, Dalam kegiatan Ekstrakurikuler Paskibra siswa belajar tentang; PBB (Peraturan Baris Berbaris), TUB (Tata Upacara Bendera), Perlakuan terhadap Bendera Merah Putih, Kepemimpinan, Kepaskibraan, dan Lagu - lagu kebangsaan.', 'd6420fd1a58bdfc38c59f3b23ac2b265.jpg', '2019-11-10 16:31:49', '2019-11-10 16:33:39', '15', '15', '1');
INSERT INTO `tbl_ekskul` VALUES (37, '16', 'Panahan', 'Panahan adalah suatu kegiatan menggunakan busur panah untuk menembakkan anak panah, juga merupakan&nbsp;salah satu Ekstrakurikuler non seni yang ada di SMA IT Mentari Ilmu Karawang. Olahraga panahan selain memiliki banyak manfaat juga merupakan aktivitas yang disunahkan oleh <i>Rasulullah SAW</i>.<br>Berikut beberapa manfaat panahan:<br>1. Meningkatkan fokus dan konsentrasi<br>2. Melatih kesabaran<br>3. Bak Untuk Mata<br>4. Menambah Kecerdasan<br>5. Olahraga Sosisal, dll.', 'cbc5ea39ea535c98e53b84b3e54f0a6c.jpg', '2019-11-10 16:43:28', NULL, '15', NULL, '1');
INSERT INTO `tbl_ekskul` VALUES (38, '16', 'Bahasa Jepang', '<span>Bahasa <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.kompasiana.com/tag/jepang\">Jepang</a> termasuk dalam sederet bahasa asing yang banyak dipelajari di Indonesia selain bahasa Inggris, Jerman, Perancis, China (mandarin), Korea, dan masih banyak lagi lainnya. Banyak manfaat yang bisa kita dapatkan hanya dengan mempelajari bahasa dari suatu Negara, misalnya untuk kepentingan pendidikan, bisnis, wisata, dan hal-hal lain.</span>Jepang dikenal sebagai Negara dengan pertumbuhan ekonomi paling pesat di Asia. Produk – produk buatan Negeri Sakura ini juga membanjiri pasar Indonesia, mulai dari setrika hingga mobil buatan Jepang, belum lagi untuk sektor lainnya. Dengan segudang kelebihan yang dimiliki oleh Jepang, tentunya tak akan sulit menimba manfaat dari mempelajari bahasanya.', 'a48b794cc305f26c65b762effdcd3791.jpg', '2019-11-10 16:58:39', NULL, '15', NULL, '1');

