INSERT INTO `tbl_pengumuman` VALUES (6, 'Recruitment', '<span>Tidak seindah namanya,&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/penyakit/kleine-levin-syndrome?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">Kleine-Levin syndrome&nbsp;</a>atau sindrom putri tidur memaksa pengidapnya untuk tertidur dalam jangka waktu yang sangat panjang. Bukannya terlihat cantik, penderitanya malah mendapatkan banyak efek negatif dari sindrom putri tidur.</span><span>Pekerjaan, kehidupan sosial, pelajaran sekolah, dan aktivitas normal lainnya menjadi sulit dilakukan dan bahkan terbengkalai.&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"https://www.sehatq.com/artikel/panduan-lengkap-memahami-gangguan-tidur-anda?utm_source=artikel&amp;utm_medium=artikel&amp;utm_campaign=internallink\">Gangguan tidur</a>&nbsp;yang langka ini tidak hanya terjadi di luar negeri tetapi juga muncul di Indonesia.</span><h2>Kisah sindrom putri tidur di Indonesia</h2>', '2019-08-03 19:29:02', '2020-02-07 09:21:09', '1', '1', '0', '02dec47be3e0946f406bc8d2de03f8b3.png', '0');
