INSERT INTO `tbl_profil` VALUES (3, '18', 'Menjadi lembaga pendidikan yang mampu menghasilkan lulusan yang sholeh, cerdas, dan kreatif.', '1.&nbsp;Mencetak insan yang taat dan berakhlaqul\r\nkarimah\r\n\r\n<br>2.&nbsp;Mencetak generasi Qur’ani\r\n\r\n<br>3.&nbsp;Mencetak insan yang menguasai Ilmu\r\nPengetahuan dan Teknologi\r\n\r\n<br>4.&nbsp;Mengembangkan kecakapan abad 21\r\n\r\n<br>5.&nbsp;Mengembangkan minat dan bakat siswa\r\n<br>6.&nbsp;Mengoptimalkan\r\npelayanan prima', '-', '-', NULL, NULL, NULL, NULL, '1');
INSERT INTO `tbl_profil` VALUES (4, '1', 'Menjadi lembaga pendidikan unggul, terampil dan berkepribadian Islam', '1.&nbsp;Mewujudkan\r\nlembaga pendidikan yang berbudaya islami dengan manajemen yang unggul dan\r\npelayanan yang prima\r\n\r\n<br>2. Mewujudkan\r\ngenerasi yang berwawasan luas dan berprestasi di bidang akademik dan\r\nnon-akademik\r\n\r\n<br>3. Mewujudkan\r\ngenerasi yang terampil dalam teknologi dan komunikasi serta memiliki jiwa\r\nkewirausahaan dan kepemimpinan\r\n\r\n<br>4. Mewujudkan generasi yang beraqidah lurus, beribadah\r\ndengan benar, dan berakhlaq terpuji', '-', '<a href=\'https://forms.gle/fQYcpxWibUFTui9x9\'>PENDAFTARAN SISWA BARU</a>', NULL, NULL, NULL, NULL, '1');
INSERT INTO `tbl_profil` VALUES (5, '16', 'Menjadi lembaga pendidikan terbaik yang mampu melahirkan lulusan yang unggul, mandiri dan berkepribadian islam.', '<div>1. Mewujudkan lulusan yang siap memasuki jenjang pendidikan selanjutnya</div><div>2. Membentuk pribadi yang amanah dan komunikatif</div><div>3. Megembangkan kecakapan abad 21</div><div>4. Membentuk pribadi yang terampil dan mandiri</div><div>5. Mewujudkan pribadi yang lurus aqidahnya, benar ibadahnya dan baik akhlaknya</div><div>6. Menyelenggarakan layanan pendidikan Islam yang prima</div><div>7. Mewujudkan generasi Qurani melalui program tahfidz</div>', '-', '-', NULL, NULL, NULL, NULL, '1');
INSERT INTO `tbl_profil` VALUES (6, '17', 'Menjadi lembaga pendidikan yang mampu menghasilkan lulusan yang sholeh, cerdas, dan kreatif.', '<span>1.&nbsp;Mencetak insan\r\nyang taat dan berakhlaqul karimah</span>\r\n\r\n<br><span>2.&nbsp;Mencetak Generasi Qur’ani</span>\r\n\r\n<br><span>3.&nbsp;Mencetak insan\r\nyang menguasai ilmu pengetahuan dan teknologi</span>\r\n\r\n<br><span>4.&nbsp;Mengembangkan kecakapan abad 21</span>\r\n\r\n<br><span>5.&nbsp;Mengembangkan\r\nminat dan bakat siswa</span>\r\n\r\nMengoptimalkan pelayanan prima', '-', '-', NULL, NULL, NULL, NULL, '1');

