INSERT INTO `tbl_tata_tertib` VALUES (5, '1', '<span>a.&nbsp;&nbsp;&nbsp;&nbsp; Menjalankan\r\nkewajiban seorang muslim</span>\r\n\r\n<br><span>b.&nbsp;&nbsp;&nbsp;&nbsp; Disiplin\r\ndalam hal waktu, penampilan, pakaian, dan belajar di sekolah</span>\r\n\r\n<br><span>c.&nbsp;&nbsp;&nbsp;&nbsp; Mengerjakan\r\ntugas tepat waktu</span>\r\n\r\n<br><span>d.&nbsp;&nbsp;&nbsp;&nbsp; Mengikuti\r\nsemua program sekolah</span>\r\n\r\n<br><span>e.&nbsp;&nbsp;&nbsp;&nbsp; Menjaga\r\nlisan dari perkataan tercela (kotor, kasar, dan jorok)</span>\r\n\r\n<br><span>f.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menjaga\r\nhijab/jarak dalam berinteraksi dengan lawan jenis (sms/telepon gombal,\r\nintens/pacaran)</span>\r\n\r\n<br><span>g.&nbsp;&nbsp;&nbsp;&nbsp; Memelihara\r\ntubuh dari hal yang merusak kesehatan (merokok, miras, narkoba).</span>\r\n\r\n<br><span>h.&nbsp;&nbsp;&nbsp;&nbsp; Menjaga\r\ndiri dari perbuatan maksiat (zina, kekerasan fisik/kriminal)</span>\r\n\r\n<br><span>i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Menyayangi\r\ndan menghormati guru, teman, tamu, dan keluarga besar Mentari Ilmu baik yang\r\nmuda maupun yang tua.</span>\r\n\r\n<br><span>j.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menciptakan\r\nkeamanan,kenyamanan, dan keteraturan lingkungan.</span>\r\n\r\n<br><span>k.&nbsp;&nbsp;&nbsp;&nbsp; Memelihara\r\ndan menjaga fasilitas sekolah dan umum</span>', '1', '2019-08-15 11:02:53', NULL, '2', NULL);
INSERT INTO `tbl_tata_tertib` VALUES (6, '16', '<div>1. Datang ke sekolah sebelum bel masuk berbunyi, bel masuk pukul 06.45 (Senin) dan pukul 07.00 (Selasa-Jumat). Peserta didik  yang dating tidak tepat waktu akan dinyatakan terlambat dengan alasan apapun.<br>2. Peserta didik berpakaian rapi sesuai standar yang telah ditetapkan.<br>3. Menghentikan kegiatan ketika adzan berkumandang dan bersegera menuju masjid<br>4. Peserta didik boleh membawa HP dengan ketentuan:<br>    a. HP tidak berkamera dan tidak terinstall Bluetooth</div><div><div>    b. HP dititipkan di kantor sebelum masuk kelas dan dibawa setelah jam sekolah selesai<br>5. Peserta didik diperkenankan membawa laptop atas instruksi guru mata pelajaran yang bersangkutan dan dipergunakan hanya saat KBM berlangsung. (di lemari kelas/kunci oleh wali kelas)<br>6. Peserta didik diperbolehkan mengendarai kendaraan bermotor jika sudah memiliki SIM</div><div>7. Peserta didik hanya membawa barang yang berhubungan dengan kegiatan belajar mengajar</div><div>8. Pulang tepat waktu<br>9. Jika peserta didik melanggar ketentuan di atas maka peserta didik akan mendapatkan konsekuensi berupa pembimbingan, peringatan lisan, tulisan, SP 1, SP II, & SP III.</div></div>', '1', '2019-08-15 11:09:20', '2019-11-10 17:08:31', '11', '15');
INSERT INTO `tbl_tata_tertib` VALUES (7, '17', '1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Siswa hadir paling lambat pukul 06.50 WIB untuk hari senin. Hari selasa sampai jumat paling lambat pukul 07.00 WIB.&nbsp;<br>2.       Bila siswa sakit atau ada hal yang harus meninggalkan sekolah, maka wajib memberitahu wali kelas. <br>3.       Siswa membawa perlengkapan shalat, peralatan gosok gigi, dan bekal makanan. <br>4.       Siswa tidak memakai perhiasan berlebihan, putri hanya boleh memakai anting. <br>5.       Siswa tidak membawa peralatan permainan yang berbahaya kecuali mendapat ijin guru. <br>6.       Siswa wajib ikut merawat sarana dan prasarana sekolah. <br>7.       Siswa tidak keluar dari lingkungan sekolah selama jam sekolah. <br>8.       Siswa membiasakan diri mengucapkan salam ketika bertemu teman, guru, karyawan, dan sesamanya juga ketika memasuki/keluar ruang kelas/guru. <br>9.      Siswa bersikap jujur, sopan, dan disiplin, baik perkataan maupun perbuatan. <br>10.   Siswa memperhatikan dan mendengarkan bila ada yang berbicara di hadapannya. <br>11.   Siswa membuang sampah pada tempat yang disediakan. <br>12.   Tidak boleh membawa HP. <br>13.   Siswa dilarang jual beli makanan, minuman, dan mainan pada saat jam pelajaran. <br>14.   Siswa wajib menghormati yang lebih tua dan menyayangi yang lebih muda. <br>15.  Siswa dilarang melakukan transaksi jual beli di lingkungan sekolah.', '1', '2019-11-21 12:16:47', '2019-11-21 12:17:42', '12', '12');

