INSERT INTO `tbl_yayasan` VALUES (1, 'Yayasan Pendidikan Mentari Ilmu', 'Jl. Perum Karaba Indah 1 Kp. Pintu Air Wadas', 'Selamat datang di Website Sekolah Islam Terpadu Mentari Ilmu Karawang. SIT Mentari Ilmu merupakan sekolah yang menerapkan kompetensi sains dan Teknologi serta menempatkan Al Qur\'an dan Sunnah sebagai dasar Panduan yang paling tinggi dan sumber dari semua keahlian dan pengetahuan.\r\n\r\nPendidikan bermutu, keterampilan dan keimanan yang kuat merupakan bekal bagi generasi mendatang dalam menghadapi perkembangan zaman dan persaingan global. Untuk itu, dibutuhkan adanya sebuah sekolah unggulan yang sarat dengan penerapan nilai-nilai Islam. Seiring dukungan do’a dari semua pihak serta tekad yang kuat, Yayasan Pendidikan Mentari Ilmu Karawang mulai merintis berdirinya SMP Islam Terpadu Mentari Ilmu mulai tahun ajaran 2009-2010, kemudian berkembang dengan mendirikan SD IT Mentari Ilmu Jatisari dan SMA IT Mentari Ilmu, dan disusul dengan berdirinya SD IT Mentari Ilmu Karawang. Dengan letak strategis dan didukung fasilitas lengkap, serta tenaga pengajar profesional dan kurikulum yang handal, diharapkan mampu menghasilkan generasi yang cerdas dan sholeh.', '082244333448', 'mentariilmuyayasan@gmail.com', 'sit.mentariilmu/', 'sit.mentariilmu/', 'SitMentariilmu', 'UCC4amGbQ8gA-uNiZDHqBPyg?view_as=subscriber', '1', '1', '2019-10-17 14:59:43', '2020-01-07 09:44:04', '1');

